    public static KlineIndc data2FundingKline(String result){
        KlineIndc klineIndc = new KlineIndc();

        Gson GsonUtil = new GsonBuilder().create();
        Result<List<FundingRateKLine>> data =  GsonUtil.fromJson(result,new TypeToken<Result<List<FundingRateKLine>>>(){}.getType());
        List<FundingRateKLine> fundingRates = data.getData();
        if(fundingRates.size()>0){
            for(FundingRateKLine fundingRateKLine:fundingRates) {
                KLineItem kline = new KLineItem();
                kline.timestamp = String.valueOf(fundingRateKLine.getBegin());
                kline.date = AppUtils.timeStamp2Date(kline.timestamp);
                kline.open = fundingRateKLine.getOpen().floatValue();
                kline.close = fundingRateKLine.getClose().floatValue();
                kline.high = fundingRateKLine.getHigh().floatValue();
                kline.low = fundingRateKLine.getLow().floatValue();
                klineIndc.klines.add(kline);
            }
        }
        return klineIndc;
    }


    public static KlineIndc data2OpenKline(String result){
        KlineIndc klineIndc = new KlineIndc();

        Gson GsonUtil = new GsonBuilder().create();
        Result<List<OpenInterestKLine>> data =  GsonUtil.fromJson(result,new TypeToken<Result<List<OpenInterestKLine>>>(){}.getType());
        List<OpenInterestKLine> fundingRates = data.getData();
        if(fundingRates.size()>0){
            int i = 0;
            for(OpenInterestKLine openInterestKLine: fundingRates) {
                KLineItem kline = new KLineItem();
                //kline.timestamp = String.valueOf(openInterestKLine.getBegin());
                //kline.date = AppUtils.timeStamp2Date(kline.timestamp);
                kline.open = openInterestKLine.getOpen().floatValue();
                kline.close = openInterestKLine.getClose().floatValue();
                kline.high = openInterestKLine.getHigh().floatValue();
                kline.low = openInterestKLine.getLow().floatValue();
                klineIndc.klines.add(kline);
            }
        }
        return klineIndc;
    }

    public static KlineIndc data2OIDelta(String result){
        KlineIndc klineIndc = new KlineIndc();

        Gson GsonUtil = new GsonBuilder().create();
        Result<List<OpenInterestKLine>> data =  GsonUtil.fromJson(result,new TypeToken<Result<List<OpenInterestKLine>>>(){}.getType());
        List<OpenInterestKLine> listK = data.getData();
        if(listK.size()>0){
            int i = 0;
            for(OpenInterestKLine openInterestKLine: listK) {
                float open = openInterestKLine.getOpen().floatValue();
                float close = openInterestKLine.getClose().floatValue();
                float val = close - open;
                klineIndc.oiDelta.add(val);
            }
        }

        return klineIndc;
    }

