    public static KlineIndc data2LiqCoin(String result){
        KlineIndc klineIndc = new KlineIndc();
        List<Long> tss = new ArrayList<>();
        List<Float> liqCoinLongList = new ArrayList<>();
        List<Float> liqCoinShortList = new ArrayList<>();
        Gson gson = new GsonBuilder().create();
        Result<List<LiquidationStatistic>> data =  gson.fromJson(result,new TypeToken<Result<List<LiquidationStatistic>>>(){}.getType());
        List<LiquidationStatistic> fundingRates = data.getData();
        if(fundingRates.size()>0){
            for (LiquidationStatistic fundingRate:fundingRates
                 ) {
                tss.add(fundingRate.getTs());
                LiquidationStatistic.Detail all = fundingRate.getAll();
                if(all.getLongTurnover() != null){
                    liqCoinLongList.add(all.getLongTurnover().floatValue());
                }else {
                    liqCoinLongList.add(0f);
                }
                if(all.getShortTurnover()  !=null){
                    liqCoinShortList.add(all.getShortTurnover().floatValue());
                }else {
                    liqCoinShortList.add(0f);
                }
            }

            klineIndc.setLiqCoinLongList(liqCoinLongList);
            klineIndc.setLiqCoinShortList(liqCoinShortList);
            klineIndc.setTimeList(tss);
        }
        return klineIndc;
    }

    public static KlineIndc data2LiqSymbol(String result){
        KlineIndc klineIndc = new KlineIndc();
        List<Long> tss = new ArrayList<>();
        List<Float> liqCoinLongList = new ArrayList<>();
        List<Float> liqCoinShortList = new ArrayList<>();
        Gson gson = new GsonBuilder().create();
        Result<List<LiquidationSymbol>> data =  gson.fromJson(result,new TypeToken<Result<List<LiquidationSymbol>>>(){}.getType());
        List<LiquidationSymbol> fundingRates = data.getData();
        if(fundingRates.size()>0){
            for (LiquidationSymbol liq:fundingRates) {
                tss.add(liq.getTs());
                liqCoinLongList.add(liq.getLongTurnover().floatValue());
                liqCoinShortList.add(liq.getShortTurnover().floatValue());
            }

            klineIndc.setLiqSymbolLongList(liqCoinLongList);
            klineIndc.setLiqSymbolShortList(liqCoinShortList);
            klineIndc.setTimeList(tss);
        }
        return klineIndc;
    }

